import React, { useState } from 'react';
import './SignIn.css'
import { FormField, Button, Checkbox, Form } from 'semantic-ui-react'
import {
     Radio, Segment, Label
  } from 'semantic-ui-react'

// Instructor Signup Form
const InstructorSignin = () => {
